(12, 'Tanaya Paladugu', 'ptanaya95@gmail.com', '', 'resume.pdf', 'I am Tanaya Paladugu and I am writing to express my interest to work as a Junior Trainee under your firm and guidance. I am a recent post graduate major in Sustainable Architecture from Gandhi Institute of Technology and Management University, Visakhapatnam.\r\n\r\nI always had a keen interest towards sustainability and sustainable design approach from my bachelors which lead to my post-graduation today. With todayâ€™s architectural designing where climatology is not considered in the initial phase leads to excessive usage of energy to achieve the basic thermal comfort which is required for the occupants. This further leads to over usage of HVAC system due to poor natural ventilation, wrong building orientation, heavy usage of glass facade which increase the indoor temperature or chose of building materials etc. at building level and at macro scale this excessive carbon emission and GHG emission is increasing global temperature which is leading to climate change. We as architects and sustainable professionals can do a small part in reducing carbon emission and GHG emission by proper designing and simulating these designs for further understanding of the building performance and choice of building materials plays an important role in terms of their embodied energy and life cycle assessment (cradle to grave study). \r\n\r\nDuring my two years of study apart from academic words-\r\nâ€¢	I have extensively published three research papers in different journals \r\nâ€¢	Enrolled as IGBC-AP\r\nâ€¢	Attended 3 days GRIHA workshop (waiting for my credentials to clear the examination)\r\nI am a dynamic and ambitious sustainable professional who possesses to learn more in sustainable designing and understanding their practical implementation. As a Junior Trainee I am looking forward to learn and correlate my learning with reality and find prospective ways to explore new areas in this field. I have been going through your works for quite some time and I am really looking forward to work under your guidance in your firm. \r\n\r\nI appreciate your consideration of my application and look forward to further discussing this opportunity with you in person. Please feel free to contact me anytime to arrange an interview\r\n', '2020-07-03 11:27:08'),
(13, 'Alveena Abraham', 'alveena24@gmail.com', '', 'Alveena resume.pdf', 'An Aspiring Energy professional paving her way in the field of Energy efficiency and Renewable energy.\r\n', '2020-07-10 02:57:59'),
(14, 'Pratik Deb', 'deb.pratik26@gmail.com', '', 'Brief Resume- Pratik.pdf', 'Highly organized, efficient, meticulous and analytical Researcher with 4 years of hands-on experience in spatial data science; climate change impact assessment; land use mapping; hydro-climatology; hydrogeology; hillslope hydrology; hydrological instrumentation and modelling and groundwater studies. Experienced in leading and guiding team members in National Level Projects. Contributed as a Hydrological Scientist as well as a Senior Researcher in creating GIS and Hydrological based solutions to increase efficiencies in GIS, Climate Change, Water Resources; Urban Water Management and Planning Sector.', '2020-07-29 05:40:55'),
