(16, 'RKS Jotham Prabhu', 'rks.jotham3@outlook.com', '', 'Jotham Resume July 2020.pdf', 'Experienced Sustainability Consultant with a demonstrated history of working in the energy conservation and infrastructure industry. Skilled in Sustainable Development, Renewable Energy Systems, Computer-Aided Design (CAD), eQuest, and Revit. Strong community and social services professional with a Master of Technology - M.Tech focused in Energy and Environmental Enginering from Vellore Institute of Technology', '2020-08-09 19:18:28'),
(17, 'Tejas Bhagwatkar', 'vbtejas@gmail.com', '', 'TEJAS BHAGWATKAR.docx', 'My name is TEJAS BHAGWATKAR and I have went through your website and I\'m interested to work in your organization as an intern or trainee .  I have done 1 yr of internship in Zeus Numerix Pvt Ltd Pune as an CFD engineer trainee .\r\n\r\nI have worked on live project and also completed my mtech project as well . I have completed mtech From Vellore institute of technology in 2020.\r\n\r\nFor reference I\'m attaching my resume. Hoping a positive response from you.\r\nThanking you.\r\n', '2020-08-21 14:01:34'),
(18, 'Himanshu Ramesh Kumbhare', 'kumbhare.himanshu@hotmail.com', '', 'HIMANSHU RAMESH KUMBHARE 17-07-2020.pdf', 'My name is Himanshu Kumbhare, I completed my Bachelor\'s in Mechanical Engineer in 2026 and thereafter I\'m working with CSIR-NEERI as a Project Assistant.  My Responsibility is purely R&D and field activities for the development of Energy Devices and Air Pollution \r\nControl in Rural Society. Handling experience of numerous instruments related to Indoor Air pollution (IAP) monitoring and \r\nmany other laboratory instruments related to Air pollution and fuel analysis. Along with this, good practices in AutoCAD to \r\nDesign the Prototypes and its development.', '2020-08-28 03:46:05'),
(19, 'Avi Mittal', 'avi.mittal28@gmail.com', '', 'Resume.pdf', 'Greetings,\r\nI hope you are safe and sound during these unusual times.\r\nIn my 3 years of experience as an architect, I\'ve come to realize that a few of the most important skills of an architect are creative thinking, critical assessment, and effective communication. The dynamics of the profession have changed in the past decade to an adaptive, interactive, and responsive architecture.\r\nAs an architect, a creator and an executor, I have the ambition of creating buildings that evolve and improving the design processes by incorporating sustainability at all levels, solving problems and\r\nproviding innovative yet practical solutions with a systematic research-oriented approach and the ability to envision and analyze systems with a broader perspective.\r\nIn 2017, I completed my B.Arch studies and since then, I have been working and learning continuously. A few of my responsibilities so far have included:\r\nâ€¢ Involvement in BIM projects and ensuring compliance with BIM\r\nstandards, preparing Execution plans and creating realistic deadlines and accomplishing targets on time.\r\nâ€¢ Undertaking activities to build team spirit and ensuring\r\ncollaboration throughout the studio.\r\nâ€¢ Responsible for driving the design process in the right direction at an optimal speed.\r\nâ€¢ From multiple interactions with clients to understand their requirements, to deal with specialists and vendors to ensure that the clients\' expectations can be matched with utmost practicality.\r\nâ€¢ Involvement across all phases of design and taking out time to research and suggest time-saving and feasible solutions that might benefit the office and client.\r\nâ€¢ Managing the marketing front and ensuring the team is adapting to the ever-changing requirements of the market.\r\nMy current project lead really appreciates my desire to take initiatives when something needs to be done, my reliability when things get out of hands, my passion for work all day every day, my time management when goals need to be set and deadlines met and my skills and knowledge when a problem needs to be solved.\r\nI understand that you receive a large number of applications for this role. I do, however, believe that my zeal, passion, and skills will allow me to resonate with your work environment and immediately start supporting the needs of your organization.\r\nI would appreciate the opportunity to discuss my application in an interview. I can be contacted at all times on the details provided above.\r\nThank you for your time and consideration.\r\nSincerely,\r\nAvi Mittal', '2020-08-30 02:30:33'),
(20, 'Jaiganesh K', 'jaiganeshk33@gmail.com', '', 'Jaiganesh CV.pdf', 'Dear Sir / Madam,\r\n\r\nVery Good Morning ! Hope you are doing well and safe,\r\n\r\nI am a Mechanical Engineering professional having on field experience in Qatar / Indian projects servicing for Green Building Consulting (Gulf projects) , MEP systems Commissioning , Environmental Engineering support & Project Management possessing a total of 7 years career experience .\r\n(Construction relevant 3.7 years)\r\n\r\nI have attached my CV for your kind reference.\r\n\r\nI am eager to work in Core Business services of Buildings & Infrastructure with immediate availability to join. Being a technical person and having international Client exposure , i am ready to take full time Business promotion roles also if offered .\r\n\r\nLooking forward to hearing from you ,\r\n\r\nThank you in advance.\r\n\r\nYours sincerely,\r\n Jaiganesh K\r\n+919655419654\r\n', '2020-09-29 23:09:06'),
