(24, 'Tushar Sahu', 'tushar.sahu457@gmail.com', '', 'Tushar CV.pdf', '\r\nI haveÂ 1.7-year experienceÂ in Building energy simulation where I handled various small and big projects in compliance with GRIHA and IGBC and was involved in various reputedÂ projects of 2 floors building to 23 floors buildings. I have also done a whole campus simulation consisting of 14 buildings where I majored in eQuest tool.\r\nI have a good knowledge of Green building ratings like GRIHA and IGBC and am also familiar with ECBC (Energy Conservation Building Code)and have experience of preparation of technical energy reports for submission to IGBC and GRIHA. I have published a paper titled Analysis and \"Design of Energy Efficient Building\" in IJRASET in May 2019.I haveÂ GRIHA certified professionalÂ certification.\r\nEnclosed is my resume offering a summary of my educational background and work experience. I would appreciate the opportunity to discuss the possibility. Thank you for your time and I look forward to hearing from you.', '2020-10-22 11:05:13'),
