(26, 'Varun Sonpar Kale', 'varunskale@gmail.com', '', 'Varun Kale_CV.pdf', 'I would like to explore whether there would be a place for me at IDS. From the IDS website, I found that my concern about environmental sustainability and energy conservation given the climate situation, as well as my expertise in building physics and green building resonates with the vision and services offered by IDS. \r\nMy basic qualification is as a civil engineer to which I have added, through an MSc specializing in Building Physics and Technology from Delft Univerity of Technology, a deeper understanding of sustainable building design in the built environment. My masterâ€™s research focused on the application of double-skin facades in different climates of India to promote energy efficiency and thermal comfort. I am currently working at AEON Integrated Building Design Consultants in Noida where I primarily facilitate green building certifications through relevant documentation, facade analysis and various client/contractor briefs to inculcate sustainable design methods into the projects. To this end, I am also in the process of becoming a LEED Green Associate and intend to pursue the LEED AP accreditation thereafter. However, I am keen to expand my work experience into further areas of my capability and intent that are cost-effective, energy-efficient and promote better living quality for occupants within the built environment.\r\nI am interested in application development for simulation tools as well as information dissemination as I saw on IDS\'s portfolio.\r\nI really look forward to hearing from you and to discuss how I can contribute to your projects and efforts for a more sustainable built environment. \r\n\r\nThanking you, \r\nVarun', '2020-10-25 08:33:56'),
