(28, 'Ar. D. Niranjhan', 'niranjihan@gmail.com', '', 'Ar. D. Niranjhan - Resume.pdf', 'Hello Sir / Ma\'am,\r\n\r\nMyself, Ar. Niranjhan Dhakshanamoorthy had completed M. Arch in Sustainable Architecture from School of Planning and Architecture, Vijayawada in the Academic year 2018. I\'m applying for the position of Sustainability Consultant in your esteemed institution. \r\n\r\nI have professional experience of 2 years and 2 months in the Architecture Industry after the completion of my Master\'s degree. I have been involved majorly in Integrated Township  Planning (ITP) projects, Residential, Commercial and Mixed-Use Projects. I have also worked on Green Certification of the projects like GRIHA & IGBC.\r\n\r\nHave been honing my skills in the building simulation studies and green building industry in the above mentioned projects with softwares such as IES-VE, Envimet, Rhino + Grasshopper, Diva, Equest, Ecotect, etc.\r\n\r\nI have published an article in the CIA Magazine (Jan - Feb 2020 edition) under the title, \" Lighting and Ventilation Issues in SRA Buildings.\" \r\n\r\nPlease find attached my resume for your perusal. My COA Registration Number is CA/2018/95102. I will bring out the best of my knowledge diligently to aid the progress of the institution.\r\n\r\nPlease let me know of any openings for the above mentioned or similar position in your esteemed institution at present or in near future.\r\n\r\nKindly do the needful.\r\n\r\nThanks and Regards,\r\nAr. D. Niranjhan., M. Arch (S.A.).,\r\nContact - +91-7397276705, +91- 9498071890.', '2020-11-07 04:10:08'),
(29, 'Intakhab Alam Khan', 'intakhab.khan@terisas.ac.in', '', 'Major internship CV [NEW] Nov.pdf', 'I am a final year M.Tech student in the field of renewable energy engineering and management from TERI University (New Delhi) India.\r\nMy major internship will start in January and the duration is 6 months, I am attaching my CV ,\r\nI am interested to work under your guidance and your company after the internship if you think I am a good fit for your company then I will continue to work with you.\r\n \r\nThanks and regards,\r\nIntakhab Alam Khan\r\n', '2020-11-17 09:07:22'),
