(31, 'MOHAMMAD AAMIR', 'aamirnalig@gmail.com', '', 'Resume.pdf', 'Hello\r\nI am Aamir, Delhi based Architect, enthusiastic about zero energy design and climate responsive building.\r\nI have been following your firm for past one year and after polishing myself to suit your track line at this point of year I feel confident to show my interest in joining your talented team.\r\nI feel that I would definitely turn out to be an asset for IDS soon,\r\nI have attached my resume to have a better idea of my background and work experiences.\r\nI look forward to a healthy discussion.', '2020-12-02 11:31:48'),
