(33, 'PM Sivaram', 'siva3991ram@gmail.com', '', 'CV_Sivaram PM (2).pdf', 'I am Sivaram PM, \'Research Scholar\' from the Department of Energy and Environment, National Institute of Technology Tiruchirappalli (NITT). I am writing this letter to apply for possible fulltime opportunities in your organization. \r\nI am in the final stage of my PhD and actively looking for jobs. My doctorate research is on the topic \"Studies on passive integrated solar energy technologies (PV/T) for domestic applications: air ventilation, clean water and electric power\" and the study mainly focused for the densely populated zones and the people in the lower-middle-class category. Part of my PhD work includes the development of a building-integrated solar energy system coupled to a building prototype developed based on \"Chief Minister\'s solar-powered green house scheme â€“ Ministry of Rural Development and Panchayat Raj, Govt. of Tamil Nadu\" for multiple outputs. The energy, environment and economic behaviour/feasibility of the developed integrated systems are compared with the conventional/commercials like coal electricity, exhaust fans and reverse osmosis units. The studies motivated me to move more towards the energy, sustainability, and economic viability, policies by the government and the awareness and response of the people. Energy access, efficiency, sustainability and security are the four central pillars of energy in India. India population in and below middle-class category are ~80%. I belevie policies are the vital tool towards attaining energy transition in this scenario. \r\nMoreover, I have practical experience in handling energy audit instruments (Power energy logger, Thermal imaging camera, Ultrasonic flow meter, and anemometers), and characterization instruments (Differential scanning calorimeter-DSC, Thermogravimetric analyser-TGA, and Hyphenated Thermogravimetric and infra-red analyzer- TG-IR). I have experience in instrument calibration for temperature parameters in the National Accredited Board of Laboratories (NABL) in NITT. I am also a part of the NITT energy Audit team and participated in the energy audits in MSMEs, Tamil Nadu. I also worked with East Coast Sustainable Private Limited in the energy audit in ITC Bhadrachalam Paper Boards Limited. Moreover, I worked as a \"Research Intern\" in Carborundum Universal Limited, Chennai and studied the inconsistent behaviour of grinding wheels cured in a tunnel oven using CFD and suggested necessary modifications to improve the above. Currently, I am carrying out data collection and analysis on Green-H2 and NH3 feasibility in India at Council on Energy Environment and Water (CEEW).\r\nKnowledge in solar energy systems, thermal processes, material characterization and sustainability studies and interest in clean energy (solar, and H2), and policies could be an advantage for me to evaluate the feasibility of sustainable energy systems. \r\nI always wish to be a part of the green economy, and I believe that my skills, experience and ideas could contribute well in your organization. I would appreciate the opportunity to introduce myself and discuss the position. \r\nKindly reply in this regard. Many thanks for considering my request.\r\n\r\nYours sincerely, \r\nP. M. Sivaram\r\n', '2020-12-14 02:37:25'),
