(44, 'Prachi Yadav', 'ar.prachiyadav16@gmail.com', '', 'Prachi Yadav Resume_2.pdf', 'Dear Sir/Ma\'am,\r\nI express my interest to apply for the post of Green Building Analyst at your organization.\r\nI wanted to thank your organization for providing this opportunity, I was looking  for the same type of work profile in this field. \r\n\r\nI have completed my Post Graduation degree in Energy-Efficient and Sustainable  Architecture course from NIT Trichy, Tamilnadu in the year 2020 and I have completed my  Graduation degree from M.E.T Faculty of Architecture, Moradabad, Uttar Pradesh  in the year 2016.\r\n\r\nMy Master\'s final year research thesis project was based on optimizing the  thermal performance of government low-cost housing schemes in rural areas for  warm and humid climate for which I worked on IES VE software for optimizing the thermal comfort conditions using energy plus weather data.\r\nI have also worked on the Griha Certification project on the daylighting analysis report and simulations during my two months internship with EDS Delhi.\r\n\r\nDuring the time spent in B.Arch and M.Arch, I have worked on many designs and  energy simulation softwares like AutoCAD, Sketch-up, Microsoft Office, IES-  VE, Dilux and Ecotect.As a qualified Architect, I am passionate to learn and study  about sustainable design & development, Green Architecture, Climate change,  Smart cities, village development, and waste management.\r\nI will be very grateful for the opportunity and believe that I will prove to be an  asset to your organization. If admitted, I promise to work hard, fulfill my duties  and be a responsible and committed employee.\r\n\r\nIf you found my application suitable for this post please let me know through my  email id- ar.prachiyadav16@gmail.com or phone number- 8077379891.', '2021-07-13 04:10:13'),
(45, 'udhaya shankar', 'pudhai.udhai27@gmail.com', '', 'Resume.pdf', 'Dear Sir/Mam,\r\nI\'m Udhaya Shankar (IGBC AP), seeking a position in your firm. I graduated from Anna University, following which I acquired my architect\'s license from The Council of Architecture (CA/2020/126674) and have worked on various green building projects. I have attached my resume for your reference.\r\n\r\nThank You', '2021-07-25 10:09:30'),
