(48, 'Sonali Ranjan', 'sonali.ranjan965@gmail.com', '', 'Sonali Ranjan_Resume.pdf', 'Respected Ma\'am/ Sir,\r\n\r\nI\'m a very focused individual with great attention to detail who can manage responsibilities in an organized manner. I also have some supervisory experience from my previous work and can handle on-site projects effectively. My biggest strengths are my ideation and devotion to every project. My previous superiors praised me for my contributions and eagerness to learn, as well as my ability to work in teams. \r\n\r\nAfter graduation in 2020 from architecture, I sought to explore my professional interests and am keen to learn more about the sustainable design approach. I believe that putting my efforts where my interests are would be far more rewarding.\r\n\r\nI\'m interested in pursuing a master\'s degree in the very subject in the future, so having the chance to work on the sorts of projects that the firm creates would help me grasp the subject in greater depth and put my abilities to use with the help of the team members. I may not be flawless in all of my deliveries, but I am willing to learn from my mistakes. I\'m also focusing on improving my software abilities and am keen to learn new software as well. \r\n\r\nThank you very much for your time and attention. I look forward to hearing from you soon.\r\n\r\nYours sincerely,\r\nSonali Ranjan\r\n', '2021-11-14 00:50:20'),
(49, 'Sneha Sara Varghese', 'ar.snehasaravarghese@gmail.com', '', 'RESUME - SNEHA SARA VARGHESE.pdf', 'I am Sneha Sara Varghese, a masters graduate in Sustainable Architecture, who is passionate about green building design.\r\nThe Post Graduation degree in Sustainable Architecture has made me well equipped with the green building field. With the theoretical knowledge and understanding gained from the programme, I am looking forward to bringing this sustainable approach effectively into architectural design and practice, through effective utilisation and management of our resources, climate responsive and passive design strategies, and energy conservation; in helping to build a more energy efficient building sector.\r\nI am confident that your practice platform will help me develop meaningful architecture with sustainable design interventions. ', '2021-11-16 22:48:17'),
