(62, 'Ar Piyush Babbar', 'pbbabbar.piyush@gmail.com', '', 'COVER LETTER & CV 0.1_compressed.pdf', 'i am pleased to be applying for the asset to the company as I am having qualities & qualifications to work with your company. What is more, I believe that it would be the opportunity of a lifetime for me to learn new things, further develop my expertise, and grow both personally and professionally.\r\nI have completed my B.ARCH from Gateway College of Architecture & Design, Sonipat, and Haryana - India in 2019.\r\nAfter that, I started working on multiple projects Individually & in collaborations also till 2020. Then I Joined Masters in Sustainability course in 2020. I did a master\'s in Sustainability from Deenbandhu Chhotu Ram University of Science & Technology, Murthal Sonipat, and Haryana, India in 2022. During my Masterâ€™s degree I became GEM CP - Assocham India with good experience in simulationâ€™s & calculations. In my Bachelors I did my Internship at Saakar Foundation, Panipat, and Chandigarh. I also worked at Ravinder Bhan & Associates. I am hardworking and work well with the team in any circumstances. I work well on drawings, 3Ds & presentations.\r\nAlso, I am working on software like Design Builder, Light Stanza, SketchUp, Enscape, Lumion, Photoshop, E- Quest, AutoCAD & a beginner in Rhino + Grasshopper. It would be great to work with you & your company. I believe that my experience & expertise are perfect for your needs.\r\nThank you for your time & consideration.\r\nSincerely,\r\nPiyush Babbar', '2022-09-13 12:15:25'),
