(23, 'Ankit', 'eos230@gmail.com', '9830525429', 'Job application for Energy Analyst ', 'Dear sir/ma\'am,\r\n\r\nThis mail is in regards to applying as an Energy Analyst in the Sustainability Vertical.\r\n\r\nMy Master\'s in Building Energy Performance gives me a forte on energy analysis for Whole building energy compliance as per ECBC 2017, renewable energy analysis and simulating baseline models. This allows a deeper understanding behind energy conservation measures to be applied in different genres of project. Rigorous work on software like eQuest (Energy Modelling), DiaLUX (Artificial Lighting Modeling), Sketchup (Architectural Modeling) and Lightstanza (Daylighting Modeling ) was required for the deliverables during my two-year course. My current thesis on \"Estimation of Infiltration rate by Blower Door method for Hotels in Ahmedabad\" is a one of kind study done for the Indian hospitality sector using  Blower door available.\r\n \r\nFurthermore, my bachelors in Construction Technology Management has given me clarity in scheduling tasks and planning ahead for live projects. Coordinating with other departments in creating a constructive workflow for a project was the major learning during my bachelor\'s internship. I have worked on Microsoft project Primavera & Revit to represent my final year thesis on \"Application of building energy modeling for a G+2 bungalow in Banglore\" \r\n\r\nMy role in your team would not only be limited to designing and working as an energy analyst but can be made flexible with the project management team on multiple projects as well\r\n\r\nIt would be great to hear back from you or forward my CV and portfolio work to you.\r\n\r\nThanking you in anticipation.', '2019-07-17 10:31:38'),
